import React from 'react';
import { AddIcon, Box, Center, Fab, FabIcon, FabLabel, GluestackUIProvider, ImageBackground, Text, VStack, View, ScrollView } from '@gluestack-ui/themed';
import { config } from '@gluestack-ui/config';
import Loader from '../components/Loader';
import Viewer from '../components/Viewer';

export default function ViewNotePage() {
    return (
        <GluestackUIProvider config={config}>
            <ImageBackground
                source={require('../img/bg.png')}
                style={{ flex: 1, justifyContent: "center" }}>
                <View flex={1}>
                    <View>
                        <Text m='$4' size='4xl' fontWeight='$bold'>This is Header</Text>
                    </View>
                    <Center>
                        <ScrollView justifyContent='center' flex={1}>
                            <VStack p='$4' >
                                <Viewer />
                                <Viewer />
                                <Viewer />
                                <Viewer />
                            </VStack>
                        </ScrollView>
                    </Center>
                </View>
            </ImageBackground>
            <View>
                <Fab size="lg" placement="bottom right" isHovered={false} isDisabled={false} isPressed={false} >
                    <FabIcon as={AddIcon} marginLeft={5} />
                    <FabLabel marginRight={5}>New</FabLabel>
                </Fab>
            </View>
            {/* <Loader /> */}
        </GluestackUIProvider>
    );
}
